INSERT INTO `items` VALUES (1,'Potion','Restores a small amount of health.',1,8,0,10),(2,'Mega Potion','Restores a moderate amount of health.',2,2,0,10),(3,'Max Potion','Fully restores health and maximizes the size of your Health Gauge.',3,210,0,2),(4,'Ancient Potion','Fully restores health and maximizes the size of your Health and Stamina Gauges.',5,345,0,1),(5,'Antidote','A cure for poison.',1,6,0,10),(6,'Herbal Medicine','Removes all traces of poison and restores a slight amount of health.',2,25,0,5),(7,'Nulberry','A mysterious berry that cures various blights.',2,120,0,10),(8,'Energy Drink','A Guild-approved beverage that boosts your stamina. Helps shake off sleep, too!',2,6,0,10),(9,'Ration','Food that restores a bit of stamina.',1,3,0,10),(10,'Rare Steak','Provides a moderate boost to your stamina. This one\'s still red in the middle.',1,3,0,10),(11,'Well-done Steak','Provides a moderate boost to your stamina and keeps it at max for a longer period. Meat done right!',2,48,0,10),(12,'Burnt Meat','Provides a small boost to your stamina. Can be eaten quickly.',1,1,0,10),(13,'Cool Drink','Provides temporary relief from extreme heat.',1,30,0,5),(14,'Nutrients','Very slightly increases your maximum health level.',2,25,0,5),(15,'Mega Nutrients','Slightly increases your maximum health level.',3,92,0,5),(16,'Immunizer','Boosts your natural ability to heal.',3,92,0,10),(17,'Astera Jerky','Juicy, dried meat made by Astera\'s chef. Boosts natural healing and cures bleeding.',2,10,0,5),(18,'Dash Juice','Dulls one\'s sense of exhaustion. Reduces stamina depletion for a time.',2,29,0,5),(19,'Mega Dash Juice','Lets you dash without tiring for longer than regular dash juice does.',3,205,0,5),(20,'Might Seed','Temporarily strengthens your attacks when ingested by improving energy flow.',2,140,0,10),(21,'Demondrug','',0,0,0,0),(22,'Mega Demondrug','',0,0,0,0),(23,'Might Pill','',0,0,0,0),(24,'Adamant Seed','',0,0,0,0),(25,'Armorskin','',0,0,0,0),(26,'Mega Armorskin','',0,0,0,0),